    "2016-07-27T22:21:09.348048",nt"name": "black-rail-pilot-survey",nt"isopen":
    false,nt"url": null,nt"notes": "Aural surveys using tape recorded calls
    proved to be an efficient and effective way to survey large expanses of shallow
    marsh for black rails (Laterallus jamaicensis). Approximately 28 to 31 rails were
    detected at 15 different sites in Florida in the spring and summer of 1989. We recommend
    further extensive surveys to determine current status and distribution of this elusive
    bird. If such surveys suggest an uncertain future for black rails and more detailed
    monitoring is deemed necessary, then detailed research will be needed to refine
    the call count method.",nt"license_title": "License Not Specified",nt"extras":
